	 ('cc316ba1-c466-4678-9daa-7cfffadc1d63','44169f27-026d-47a7-b9fe-a7a844806b15','Cachoeira','Véu de noiva','Cachoeira Véu de noiva','Linda cachoeira com um imenso paredão de pedra com um poço de aguas claras','4ebd3927487751d97b0940c11acfcb24.jpg','-21.553208','-44.6386336',false,false,true,false,true,'Fácil/Médio','10 a 15 minutos',true,'7km',true,'2m','60m',true,true,false,NULL,'2022-08-17 07:30:22.82','2022-08-17 07:30:22.822'),
	 ('9e202c73-df98-4771-b65d-1dbb2bbe81f1','44169f27-026d-47a7-b9fe-a7a844806b15','Cachoeira','da Serrinha','Cachoeira da Serrinha','Linda cachoeira com aguas claras, fica um tanto quanto isolada do parque da Fumaça, mas vale a pena a pequena caminhada.','319fc48841eeaa80236ae7247f96f714.jpg','-21.553208','-44.6386336',false,false,true,false,true,'Fácil/Médio','15 a 30 minutos',true,'7km',true,'2m','60m',true,true,false,NULL,'2022-08-17 07:32:25.261','2022-08-17 07:32:25.262'),
	 ('2f053c79-7a99-4647-817e-4b972398d8d2','44169f27-026d-47a7-b9fe-a7a844806b15','Cachoeira','da Fumaça','Cachoeira da Fumaça','Forneceu energia para a cidade de Carrancas muitos anos atrás devido a sua forte queda.Uma cachoeira muito convidativa e forte, o que levou a ficar imprópria para banho devido ao alto índice de afogamento.Uma pequena praia, rochas em seu redor e um ambiente encantador!','5b24efc63a8d0c4c6d6b6705acc9c389.jpg','-21.553208','-44.6386336',false,true,false,false,true,'Fácil/Médio','5 a 10 minutos',true,'7km',true,'5m','10m',true,true,false,NULL,'2022-08-17 07:35:19.581','2022-08-17 07:35:19.582'),
	 ('543063f4-39e5-4192-948c-c04d5347a83b','7f69ba63-9a55-4cd0-a8ff-c7fff47010f5','Cachoeira','da Zilda','Cachoeira da Zilda','Uma linda queda com um poço um pouco agitado, além de uma bela pequena praia para descansar, assim podemos descrever esse lugar.Quer descansar e ainda apreciar a natureza? Conheça a cachoeira da Zilda.','4d7754584e05ff6742783c795c13fdd2.jpg','-21.553208','-44.6386336',false,false,false,true,true,'Fácil/Médio','5 a 10 minutos',true,'10km',true,'5m','5m',true,true,false,NULL,'2022-08-17 07:41:48.192','2022-08-17 07:41:48.193'),
	 ('197a239a-1e4a-41a2-8a09-9b25db9dbe21','7f69ba63-9a55-4cd0-a8ff-c7fff47010f5','Cachoeira','da Proa','Cachoeira da Proa','Um lindo paredão de pedra com uma corredeira bem forte em sua base.O poço é lindo e o ambiente ao redor é encantador, você pode banhar-se enquanto aprecia a bela vista do paredão.','499601b323cf23ba7dd9912b6736f9f2.jpg','-21.553208','-44.6386336',false,false,false,true,true,'Fácil/Médio','5 a 15 minutos',true,'10km',true,'5m','1m',true,true,false,NULL,'2022-08-17 07:43:39.766','2022-08-17 07:43:39.766'),
	 ('d3c48ff4-b805-4ecf-8aee-eb45a7b786b2','7f69ba63-9a55-4cd0-a8ff-c7fff47010f5','Cachoeira','do Guatambu','Cachoeira do Guatambu','Uma ambientação diferente e linda com um chuveirão de 6 metros de queda fina sem falar de seu belo poço de agua fria e clara.','e1853a30ecac876d05f5ef564ab6b5ef.jpg','-21.553208','-44.6386336',false,false,false,true,true,'Fácil/Médio','15 a 30 minutos',true,'10km',true,'7m','1.8m',true,true,false,NULL,'2022-08-17 07:45:48.561','2022-08-17 07:45:48.562'),
	 ('9c1b2e0c-6d07-4d5e-9e4a-7c6f44f61cc8','fff912b9-3f8b-4e4a-b768-a7b8df6269d7','Cachoeira','da Esmeralda','Cachoeira da Esmeralda','A cachoeira mais linda de Carrancas, com aguas cristalinas e uma profundidade máxima de 5.5 metros, a cachoeira da Esmeralda tem uma beleza incrível.Um lugar para se reconectar com a mãe natureza!','8136c4b13380631769841b9bcbef7b6f.jpg','-21.468829','-44.7051156',false,false,false,true,true,'Fácil/Médio','15 a 25 minutos',true,'10km',true,'5m','2m',true,true,false,NULL,'2022-08-18 20:46:18.106','2022-08-18 20:46:18.11'),
	 ('a82bb246-70bb-4086-b6b0-a659f1b5d868','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Cachoeira','das Borboletas','Cachoeira das Borboletas','Linda cachoeira semelhante a cachoeira do Guatambu. Lugar calmo com aguas claras e rasas.','f97dd131f11f3766641a11faec2a35b3.jpg','-21.563453','-44.6404867',false,false,false,true,false,'Fácil/Médio','5 a 15 minutos',true,'10km',true,'0.5m','3.5m',true,true,false,NULL,'2022-08-19 00:07:21.281','2022-08-19 00:07:21.286'),
	 ('28044267-43fc-4078-8cea-c19392c0328f','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Cachoeira','dos Índios','Cachoeira dos Índios','Linda cachoeira perto da queda da Zilda','779a6bddfe8a10cb405a01a7a9e4b6f9.jpg','-21.5583359','-44.6380366',false,false,false,true,false,'Fácil/Médio','5 a 10 minutos',true,'10km',true,'1.5m','1m',true,true,false,NULL,'2022-08-19 00:20:15.568','2022-08-19 00:20:15.569'),
	 ('2313cf26-a166-478d-ae89-e4d2afe3c939','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Pinturas','Rupestres','Pinturas Rupestres','Carrancas reserva algumas surpresas para os visitantes, especialmente para os que se interessam pela documentação natural do homem. As pinturas rupestres em Carrancas foram encontradas no complexo da Zilda e são autênticas representações pintadas em vermelho, na rocha, que datam cerca de 3.500 anos atrás.','94bde837dbe5d6fa070a4b81f0dc7a26.jpg','-21.5580115','-44.6393415',false,false,false,true,false,'Fácil/Médio','5 a 10 minutos',false,'10km',true,'0','0',false,true,false,NULL,'2022-08-19 00:32:14.941','2022-08-19 00:32:14.941'),
	 ('238f33be-6ade-4202-b7f6-160fbbe063a3','c2f9950a-dd95-4cbe-a188-61dc0133b603','Serra','das Broas','Serra das Broas','Vale a pena chegar até aqui. O caminho é mais acessível para veículos 4x4, passando por dentro de pequenos rios, subidas muito íngremes e descidas alucinantes, a estrada nos leva por várias cachoeiras e paisagens deslumbrantes. Em alguns momentos, vista 360° de toda a região de Carrancas.','1fa3fb3b25c131a86834cb91a56a6634.jpg','-21.6019844','-44.6024012',true,false,true,true,true,'Médio','30 a 40 minutos',false,'15km',true,'0','0',false,true,false,NULL,'2022-08-19 00:51:01.656','2022-08-19 00:51:01.656'),
	 ('b9f4e9b9-20ac-4886-86eb-80bbd07069a8','c2f9950a-dd95-4cbe-a188-61dc0133b603','Cachoeira','Grande','Cachoeira Grande','Uma das mais altas se não a mais alta da região.','bd79324e030f4473e673aeb6589d8c72.jpg','-21.601412','-44.6007663',true,false,true,true,true,'Médio','20 a 40 minutos',true,'15km',true,'0.5','70',false,true,false,NULL,'2022-08-19 00:53:58.65','2022-08-19 00:53:58.651'),
	 ('2711337b-3c7e-4209-9b5d-9d621706b364','c2f9950a-dd95-4cbe-a188-61dc0133b603','Cachoeira','do Pulo','Cachoeira do Pulo','Linda cachoeira para saltar.','74ec97bdf6535eea36a65c50367af98c.jpg','0','0',true,false,true,true,true,'Médio','10 a 20 minutos',true,'15km',true,'2.5m','3.5m',false,true,false,NULL,'2022-08-19 00:56:16.442','2022-08-19 00:56:16.443'),
	 ('03495599-1f40-4445-b703-e9527ff22166','d97f5482-2dde-40ab-b311-015574a3d46c','Poço','Tira-Prosa','Poço Tira-Prosa','A Cachoeira do Tira Prosa tem esse nome em homenagem a Sebastião Guimarães Monteiro, que morava perto da trilha de acesso ao poço e adorava tirar uma prosa com os visitantes. Seu poço é repleto de lambaris.','70dca6fde15ab1dd24f7316721612012.jpg','-21.4762363','-44.6430604',false,false,false,true,false,'Fácil/Médio','5 a 10 minutos',true,'2km',true,'2m','0',false,true,false,NULL,'2022-08-19 01:28:13.149','2022-08-19 01:28:13.15'),
	 ('f08245e8-6245-4a37-b049-4604a6150ce7','d97f5482-2dde-40ab-b311-015574a3d46c','Poço','do Pulo','Poço do Pulo','Um poço de aguas claras e um lugar para saltar.','6f3dffb028239aa11f6dd6c1a1697f94.jpg','-21.4740019','-44.6440071',false,false,false,true,false,'Fácil/Médio','10 a 20 minutos',true,'2.5km',true,'2m','0',false,true,false,NULL,'2022-08-19 01:37:33.23','2022-08-19 01:37:33.231'),
	 ('c5ec5051-a357-49d3-9c18-b9d115749f57','d97f5482-2dde-40ab-b311-015574a3d46c','Poço','da Canoa','Poço da Canoa','É ladeado por paredões rochosos e é o principal poço do complexo, apesar de ficar ao lado dos demais. Tem formato de uma canoa, justificando o nome.','51875ecd71d71ec2759ce990fca90ef7.jpg','-21.4740019','-44.6440071',false,false,false,true,false,'Fácil/Médio','10 a 15 minutos',true,'2.5km',true,'2m','0',false,true,false,NULL,'2022-08-19 01:39:10.26','2022-08-19 01:39:10.261'),
	 ('ee612a46-dcba-4b2d-a3e4-91ac24d9faef','fff912b9-3f8b-4e4a-b768-a7b8df6269d7','Poço','Três irmãos','Poço Três Irmãos','Lindo poço antes da cachoeira da esmeralda. Faz parte de uma série de corredeiras e pequenas quedas formam um complexo de poços e piscinas naturais. É bom reservar um tempo para visitar o complexo, cheio de atrações.','164eea83148c7ea6ee66203ab3714cf3.jpg','-21.4740019','-44.6440071',false,false,false,true,true,'Fácil/Médio','10 a 15 minutos',true,'2.5km',true,'1m','0',false,true,false,NULL,'2022-08-19 01:55:10.831','2022-08-19 01:55:10.832'),
	 ('294280d5-a9ef-4e3c-a2a3-3cd5957376e7','fff912b9-3f8b-4e4a-b768-a7b8df6269d7','Poço','Louva Deus','Poço Louva Deus','Um lindo poço a poucos metros da Esmeralda, aguas claras com grandes e belas pedras para tomar um sol.','3c3fab6e46ffaff63624baa31d7ac768.jpg','-21.4740019','-44.6440071',false,false,false,true,true,'Fácil/Médio','10 a 15 minutos',true,'10km',true,'1m','0',false,true,false,NULL,'2022-08-19 01:57:26.255','2022-08-19 01:57:26.256'),
	 ('ce03397c-bc45-46ea-b83f-06e51e7e958f','27f923b3-4d74-4b93-ae65-3e1683978854','Lagoa','Azul','Lagoa Azul','A tonalidade de cores é a grande beleza do lugar, se revezando entre o verde e o azul.','5e07f6d0bea19954d116d339a3bf014f.jpg','0','0',false,false,true,true,true,'Fácil/Médio','20 a 30 minutos',true,'11km',true,'7m','0',true,false,false,NULL,'2022-08-19 05:11:35.618','2022-08-19 05:11:35.619'),
	 ('345e0332-4155-433b-a594-b1cdcfd427c9','a623c489-692b-4f69-ac27-324c96a59b16','Cachoeira','do Moinho','Cachoeira do Moinho','Antigamente, um moinho de milho que usava a força da cachoeira para produzir farinha, e foi daí que veio o nome da Cachoeira do Moinho, também tranquila e com trilha leve, possui diversas piscinas naturais, não muito grandes, mas perfeitas para um breve mergulho. A cachoeira tem uma boa queda, ótima para aliviar o corpo e a mente, suas águas formam um poço bonito com poucos pontos mais profundos.','af5b59f5a91cfa08b7aa273a386d2281.jpg','-21.473208','-44.6510607',false,false,false,true,true,'Fácil/Médio','10 a 15 minutos',true,'3km',true,'2m','2m',false,true,false,NULL,'2022-08-19 02:14:31.056','2022-08-19 02:14:31.057'),
	 ('f36e84a1-ef1b-483a-918e-76ab9bc861b4','a623c489-692b-4f69-ac27-324c96a59b16','Cachoeira','do Salomão','Cachoeira do Salomão','Esta é a primeira cachoeira da trilha que leva até o Moinho. Alta e com boa queda d’água, faz uma verdadeira massagem natural; não chega a ter poços para banhos, mas o visual é muito bonito e é ao descer até sua base, que se pode ter real dimensão de sua beleza.','c54c94ffef6b839b54eb613a941f7592.jpg','-21.473208','-44.6510607',false,false,false,true,true,'Fácil/Médio','10 a 15 minutos',true,'3km',true,'1m','6m',false,true,false,NULL,'2022-08-19 02:16:36.693','2022-08-19 02:16:36.694'),
	 ('de6c69ad-94c8-4bc1-b1f0-71278cf34372','a623c489-692b-4f69-ac27-324c96a59b16','Poço','da Perdição','Poço da Perdição','Lindo poço escondido de aguas geladas.','a42fdb976309cddeced0b58851a45d13.jpg','-21.473208','-44.6510607',false,false,true,true,false,'Fácil/Médio','10 a 20 minutos',true,'3km',false,'4m','0',false,true,false,NULL,'2022-08-19 02:18:52.779','2022-08-19 02:18:52.78'),
	 ('91d6f299-0caa-46be-b027-dc7a707cf6ad','a623c489-692b-4f69-ac27-324c96a59b16','Poço','da Ponte','Poço da Ponte','Uma bela piscina natural formada pelas águas das cachoeiras próximas, localizada próximo a estrada que dá acesso para Itutinga. Devido ao acesso fácil e a tranquilidade do lugar, este poço já foi bastante frequentado pelos moradores e visitantes, entretanto após a construção da atual ponte de concreto, o lugar teve sua beleza transformada.','cover.jpg','-21.473208','-44.6510607',false,false,false,false,false,'Fácil/Médio','5 a 10 minutos',true,'2km',true,'1.5m','0',false,true,false,NULL,'2022-08-19 02:23:03.39','2022-08-19 02:23:03.391'),
	 ('6f2648ce-bb3b-4397-95b3-ed8d5946dbcf','9b979a1e-cd67-4d3e-92f7-b4d73c37f3e6','Poço','do Coração','Poço do Coração','Aqui você vai sentir-se em um verdadeiro SPA natural. O Poço do Coração tem esse nome graças à formação rochosa arredondada que lembra mesmo um coração e que está há apenas 3 km da cidade. Duas atrações fazem do complexo um dos mais completos: uma delas é uma rocha que permite atravessar por uma fenda, por debaixo da água, e sair em outro ponto do poço.','d15d1e2037fd01d57cfff98267f50f78.jpg','-21.4714644','-44.6826648',false,false,false,true,true,'Fácil/Médio','15 a 30 minutos',true,'2.5km',true,'2m','2m',true,true,false,NULL,'2022-08-19 02:34:30.423','2022-08-19 02:34:30.424'),
	 ('96f23db0-cccf-40ff-b020-b33e1242cece','9b979a1e-cd67-4d3e-92f7-b4d73c37f3e6','Gruta','da Toca','Gruta da Toca','Com mais de 300 metros de extensão, a gruta pode ser totalmente percorrida a pé. Em alguns trechos só se passa agachado e é inevitável não se molhar, pois o caminho fica dentro d’água. Uma aventura incrível, em que se passa pelas fendas esculpidas durante milhões de anos, cujas imagens na pedra quartzito mexem com a imaginação dos visitantes.','0d3db789628ea19fe444eeadfe03fb90.jpg','-21.4714644','-44.6826648',false,false,true,true,false,'Fácil/Médio','15 a 30 minutos',true,'2.5km',true,'0','0',false,true,false,NULL,'2022-08-19 02:37:55.832','2022-08-19 02:37:55.833'),
	 ('ff82a265-a841-4046-9fd8-756e0a66477c','9b979a1e-cd67-4d3e-92f7-b4d73c37f3e6','Escorregador','da Toca','Escorregador da Toca','São 15m de escorregador natural.A diversão é garantida, pois o escorregador fica próximo de poços e piscinas naturais.','149eea1a7bdf00abc00a18cddf1d965b.jpg','-21.4714644','-44.6826648',false,false,false,true,false,'Fácil/Médio','10 a 20 minutos',true,'2.5km',true,'0','0',false,true,false,NULL,'2022-08-19 02:39:53.612','2022-08-19 02:39:53.613'),
	 ('c8d26b4e-4397-40d7-8c12-90beaf9eb0dd','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Cânion','Racha da Zilda','Cânion Racha da Zilda','Passeio para quem sabe nadar e mergulhar muito bem, chegar na Racha não é tarefa tão fácil, é preciso atravessar um poço chamado Sonrisal, entrar no cânion que dá passagem para a racha e atravessá-la a nado contra a correnteza. E haja fôlego. Ao chegar no final da jornada, o último salão é o útero da Zilda tem uma cachoeira linda, num cenário espetacular.','8f913836f3063753f08fc060a41ab22c.jpg','-21.5612396','-44.6335627',false,false,true,true,true,'Fácil/Médio','20 a 30 minutos',true,'11km',false,'0','0',false,true,false,NULL,'2022-08-19 02:51:19.442','2022-08-19 02:51:19.443'),
	 ('e2863695-187d-4cc3-93db-1fe5413455fe','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Cânion','Racha da Zilda','Cânion Racha da Zilda','Passeio para quem sabe nadar e mergulhar muito bem, chegar na Racha não é tarefa tão fácil, é preciso atravessar um poço chamado Sonrisal, entrar no cânion que dá passagem para a racha e atravessá-la a nado contra a correnteza. E haja fôlego. Ao chegar no final da jornada, o último salão é o útero da Zilda tem uma cachoeira linda, num cenário espetacular.','b42fdb8c785834cae2c466b457a252b2.jpg','-21.5607742','-44.6337751',false,false,true,true,true,'Fácil/Médio','20 a 30 minutos',true,'11km',false,'1m','20m',false,true,false,NULL,'2022-08-19 02:54:10.282','2022-08-19 02:54:10.283'),
	 ('56476e75-780b-4e05-8591-fca430697e59','5ba891a9-88d0-45b9-8f15-4a1fb77b2fa9','Poço','da Compostela','Poço da Compostela','Um poço com poucas informações, mas fica a caminho da racha da Zilda.','4be3df694a3c3027746ddea5ee3f78e1.jpg','0','0',false,false,true,true,false,'Fácil/Médio','20 a 30 minutos',true,'11km',false,'3m','0',false,true,false,NULL,'2022-08-19 03:12:26.303','2022-08-19 03:12:26.304'),
	 ('1be8646a-228e-47b6-b2fb-1f2f56556005','27f923b3-4d74-4b93-ae65-3e1683978854','Cachoeira','do Grão Mogol','Cachoeira do Grão Mogol','Um lugar inesquecível! Rodeado por muita natureza, o Complexo do Grão Mogol é formado por incontáveis poços e quedas d`água cristalinas correndo pelas rochas, um cenário de extrema beleza. Para ter acesso ao início da trilha é necessário antes pegar a chave da porteira em um ponto de fácil localização (existe placa sinalizando), antes de passar pela sede da fazenda antiga que leva o mesmo nome do Complexo.','0ea4a92e08c145a6955d75e72c405ea0.jpg','-21.5778378','-44.6917831',false,false,true,true,true,'Fácil/Médio','20 a 30 minutos',true,'12km',true,'3m','2m',false,true,false,NULL,'2022-08-19 03:18:24.178','2022-08-19 03:18:24.179'),
	 ('c5fce4f5-2266-4d36-ab95-b007ccc66575','27f923b3-4d74-4b93-ae65-3e1683978854','Cânion','do Grão Mogol','Cânion do Grão Mogol','Excelente lugar para visitar e tirar lindas fotos com toda a familia, belas pedras ao redor que deixao o ambiente exuberante.','0048a7170fd4c27e747c279c25ea3aa7.jpg','-21.5778378','-44.6917831',false,false,true,true,true,'Fácil/Médio','20 a 30 minutos',true,'12km',true,'1m','1m',false,true,false,NULL,'2022-08-19 03:21:06.284','2022-08-19 03:21:06.285'),
